import React from 'react';
import ReactDOM from 'react-dom';
import { Navbar, Nav, Container } from 'react-bootstrap';

function Header() {
  return (
   <Navbar bg="secondary" class="navbar navbar-expand-lg navbar-light bg-light" expand="lg">
      <Container>
        <Navbar.Brand href="/">
        <img class="herald-logo lazyloaded" src="https://procodersonline.com/wp-content/uploads/2020/06/procodersonlinecom.png" alt="Coding Tricks, How To Guides and Error Fixes" data-lazy-src="https://procodersonline.com/wp-content/uploads/2020/06/procodersonlinecom.png" data-was-processed="true" style={{width: "225px;"}} /></Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ml-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/register">Register</Nav.Link>
            <Nav.Link href="/login">Login</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  )
}

export default Header
